import React from 'react'

const Boton = ({texto,cambiar,lotoco}) => {
  return (
    <div className='butto'>
      <button  onClick={cambiar} className={'lotoco' ?'botonencendido' : 'botonapagado'}      > 
      {texto }
      </button>
    </div>
  )
}

export default Boton
